import React, { useEffect, useState } from "react";
import axios from "axios";

const ShortlistedResumes = () => {
  const [resumes, setResumes] = useState([]);

  useEffect(() => {
    const fetchResumes = async () => {
      try {
        const response = await axios.get("http://127.0.0.1:5001/shortlisted");
        setResumes(response.data);
      } catch (error) {
        console.error("Error fetching shortlisted resumes");
      }
    };
    fetchResumes();
  }, []);

  return (
    <div className="card p-4 mt-4 shadow-lg">
      <h4>Shortlisted Resumes</h4>
      <ul className="list-group">
        {resumes.length > 0 ? (
          resumes.map((resume, index) => (
            <li key={index} className="list-group-item">
              <strong>{resume.name}</strong> - {resume.status}
            </li>
          ))
        ) : (
          <li className="list-group-item text-muted">No resumes shortlisted yet</li>
        )}
      </ul>
    </div>
  );
};

export default ShortlistedResumes;
